import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg bg-body-tertiary">
      <ul>
        <li>
          <Link to="/">Login</Link>
        </li>
        <li>
          <Link to="/form">Data Form</Link>
        </li>
        <li>
          <Link to="/table">Data Table</Link>
        </li>
      </ul>
    </nav>



  );
};

export default Navbar;
